import java.util.ArrayList;
import java.util.Comparator;
import java.util.LinkedList;
import java.util.List;
import java.util.PriorityQueue;
import java.util.Queue;
import java.util.Scanner;
import java.util.Stack;

public class Solution {
	static boolean isDebug = false;

	public static void main(String[] args) {
		Scanner in = new Scanner(System.in);
		int N = in.nextInt();

		if (in.hasNextLine()) {
			in.nextLine();
		}
		for (int i = 0; i < N; i++) {
			String s = in.nextLine();
			process(s);
		}

	}

	private static void process(String s) {
		List<Action> aList = new ArrayList<>();
		String[] ss = s.split("\\s");
		for (String str : ss) {
			Action act = new Action(str);
			aList.add(act);
		}

		classifyList(aList);

	}

	private static void classifyList(List<Action> aList) {

		boolean isQ = isQueue(aList);
		boolean isS = isStack(aList);
		boolean isPQ = isPQueue(aList);

		if (isDebug) {
			System.err.println(isQ + ", " + isS + ", " + isPQ);
		}
		if (isQ && !isS && !isPQ) {
			System.out.println("queue");
		}

		else if (!isQ && isS && !isPQ) {
			System.out.println("stack");
		}

		else if (!isQ && !isS && isPQ) {
			System.out.println("priority queue");
		}

		else if (!isQ && !isS && !isPQ) {
			System.out.println("mystery");
		}

		else {
			System.out.println("unsure");
		}
	}

	// bigger values pop out first
	private static boolean isPQueue(List<Action> aList) {
		Queue<Integer> myOutList = new LinkedList<>();
		Queue<Integer> givenOutList = new LinkedList<>();

		PriorityQueue<Integer> pq = new PriorityQueue<>(new Comparator<Integer>() {
			@Override
			public int compare(Integer o1, Integer o2) {
				return Integer.compare(o2, o1);
			}
		});
		for (Action act : aList) {
			if (act.op == 'i') {
				pq.add(act.val);
			} else {
				if (pq.isEmpty()) {
					return false;
				}
				myOutList.add(pq.poll());
				givenOutList.add(act.val);
			}
		}

		if (isDebug) {
			System.err.println("PQ test");
			System.err.println("myOut   =" + myOutList);
			System.err.println("givenOut=" + givenOutList);
		}
		while (!myOutList.isEmpty() && !givenOutList.isEmpty()) {
			if (myOutList.poll() != givenOutList.poll()) {
				return false;
			}
		}
		return true;
	}

	private static boolean isStack(List<Action> aList) {
		Stack<Integer> stack = new Stack<>();
		Queue<Integer> myOutList = new LinkedList<>();
		Queue<Integer> givenOutList = new LinkedList<>();

		for (Action act : aList) {
			if (act.op == 'i') {
				stack.push(act.val);
			} else {
				if (stack.isEmpty()) {
					return false;
				}
				myOutList.add(stack.pop());
				givenOutList.add(act.val);
			}
		}
		if (isDebug) {
			System.err.println("Stack test");
			System.err.println("myOut   =" + myOutList);
			System.err.println("givenOut=" + givenOutList);
		}
		while (!myOutList.isEmpty() && !givenOutList.isEmpty()) {
			if (myOutList.poll() != givenOutList.poll()) {
				return false;
			}
		}
		return true;
	}

	private static boolean isQueue(List<Action> aList) {
		Queue<Integer> q = new LinkedList<>();
		Queue<Integer> myOutList = new LinkedList<>();
		Queue<Integer> givenOutList = new LinkedList<>();

		for (Action act : aList) {
			if (act.op == 'i') {
				q.add(act.val);
			} else {
				if (q.isEmpty()) {
					return false;
				}
				myOutList.add(q.poll());
				givenOutList.add(act.val);
			}
		}

		if (isDebug) {
			System.err.println("Q test");
			System.err.println("myOut   =" + myOutList);
			System.err.println("givenOut=" + givenOutList);
		}
		while (!myOutList.isEmpty() && !givenOutList.isEmpty()) {
			if (myOutList.poll() != givenOutList.poll()) {
				return false;
			}
		}
		return true;
	}

}

class Action {
	char op; // i is push; o is pop
	int val; // the number pushed or popped

	public Action(String str) {
		op = str.charAt(0);
		val = Integer.parseInt(str.substring(1));
	}

	@Override
	public String toString() {
		return "Action [op=" + op + ", val=" + val + "]";
	}
}
